import { useState } from "react";
import StudyList from "./StudyList";
import TopMenu from "./TopMenu";

function App() {
  const [login, setLogin] = useState(false);
  return (
    <div>
      <TopMenu login={login} />
      <StudyList />
    </div>
  );
}

export default App;
